Another Place, Crosby Beach

&quot;Another Place is a piece of modern sculpture by Sir Antony Gormley located at Crosby Beach in Merseyside, England. It consists of 100 cast iron figures facing towards the sea&quot;

We got quite lucky with the incoming rain! This was the last photo of the evening after watching the wind turbines disappear. Just as we got back to the car it started raining heavily!

